const Button = ({isLoginState, name})=>{
    if(isLoginState){
        return <button>{name}</button>
    }
};

const Login = ()=>{ 
    <>
    <Button isLoginState ={true} name="Login" />
    <Button isLoginState ={false} name="Logout" />
    </>
};

export default Login;
